How do I find the intersection between an array of objects and a collection in MongoDB?<p>Given a Mongo collection of data of the form:</p>
<pre><code>// 'Entities'
{ tags: [{ a: '1', b: '1' }, { a: '2', b: '3' }] }
{ tags: [{ a: '1', b: '2' }, { a: '2', b: '3' }] }
{ tags: [{ a: '4', b: '4' }, { a: '4', b: '5' }, { a: '6', b: '7' }] }
</code></pre>
<p>I'd like to find all documents whose 'tag' entry has any of the following objects:</p>
<pre><code>[{ a: '1', b: '1' }, { a: '4', b: '4' }]
</code></pre>
<p>With the example data, this would match the first and third elements:</p>
<pre><code>{ tags: [{ a: '1', b: '1' }, { a: '2', b: '3' }] }
{ tags: [{ a: '4', b: '4' }, { a: '4', b: '5' }, { a: '6', b: '7' }] }
</code></pre>
<p>At the moment I'm doing it with a generated query (JS):</p>
<pre><code>entities.find({
    $or: tags.map(tag =&gt; ({
      tags: { $elemMatch: tag },
    })
})
</code></pre>
<p>But this seems very inefficient, as if the number of tags I'm searching for is large I'll be essentially running hundreds of separate queries.  Is there a better way?</p>

